* The analytical engine was potentially capable of general-purpose computation long before the advent of digital computers like Colossus and ENIAC, so its invention might have revolutionized early 20th century technology much as the personal computer did from the late 1970s onwards. This could mean that the dominant models of computation during World War II and the Cold War might have been mechanical rather than electronic;
